      data = JSON.stringify(data);
      data = data.replace(/"deptName"/g, '"text"');
      // 转换id参数，为保证唯一，特加jt字母
      data = data.replace(/"deptId":"/g, '"id":"' + this.jsTreeIdStr);
      // jstree自定义LI参数
      data = data.replace(/"manager":false/g, '"manager":false,"li_attr":{"class":"disabled"}');
      return JSON.parse(data);
    },
    formateDataToBusinessData: function (data) {
      data = JSON.stringify(data);
      data = data.replace(/"text"/g, '"deptName"').replace(/"id"/g, '"deptId"');
      data = data.replace(/,"state":{"selected":true}/g, '');
      data = data.replace(new RegExp(this.jsTreeIdStr, 'g'), '');
      return JSON.parse(data);
    },
    setItemSelected: function (data, id) {
      data = JSON.stringify(data);
      data = data.replace(new RegExp('"deptId":"' + id + '"', 'g'), '"deptId":"' + id + '","state":{"selected":true}');
      return JSON.parse(data);
    }
